import React, { Component } from 'react'
import './home.css'

export default class MyCart extends Component {
    constructor(props){
        super(props)
        this.state = {
            quantity: 1,
            display: true, 
            autoplay: false,
            min: 0,
        }
    }
    

render(){
    return(
        <svg className="Rectangle_14">
        <rect id="Rectangle_14" rx="48.5" ry="48.5" x={0} y={0} width={544} height={97}>
        </rect>
      </svg>
    )
}

}
